import{_ as a,c as e,o,ag as i}from"./chunks/framework.Ds6Eueu6.js";const T=JSON.parse('{"title":"DROP TEXT SEARCH DICTIONARY","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_TEXT_SEARCH_DICTIONARY.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_TEXT_SEARCH_DICTIONARY.md"}'),s={name:"docs/7x/ref_guide/sql_commands/DROP_TEXT_SEARCH_DICTIONARY.md"};function n(r,t,d,c,l,h){return o(),e("div",null,t[0]||(t[0]=[i('<h1 id="drop-text-search-dictionary" tabindex="-1">DROP TEXT SEARCH DICTIONARY <a class="header-anchor" href="#drop-text-search-dictionary" aria-label="Permalink to &quot;DROP TEXT SEARCH DICTIONARY&quot;">​</a></h1><p>Removes a text search dictionary.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP TEXT SEARCH DICTIONARY [ IF EXISTS ] &lt;name&gt; [ CASCADE | RESTRICT ]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP TEXT SEARCH DICTIONARY</code> drops an existing text search dictionary. You must be the owner of the dictionary to run this command.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the text search dictionary does not exist. WarehousePG issues a notice in this case.</p><p>name : The name (optionally schema-qualified) of an existing text search dictionary.</p><p>CASCADE : Automatically drop objects that depend on the text search dictionary, and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the text search dictionary if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove the text search dictionary <code>english</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP TEXT SEARCH DICTIONARY english;</span></span></code></pre></div><p>This command will not succeed if there are any existing text search configurations that use the dictionary. Add <code>CASCADE</code> to drop such configurations along with the dictionary.</p><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>There is no <code>CREATE TEXT SEARCH DICTIONARY</code> statement in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_TEXT_SEARCH_DICTIONARY.html">ALTER TEXT SEARCH DICTIONARY</a>, <a href="./CREATE_TEXT_SEARCH_DICTIONARY.html">CREATE TEXT SEARCH DICTIONARY</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',20)]))}const u=a(s,[["render",n]]);export{T as __pageData,u as default};
